import React, { useEffect } from 'react';
import Navbar from './Navbar';
import ChallengeView from './ChallengeView';
import '../styles/Common.css';

const Home = () => {
    return(
        <React.Fragment>
            <Navbar/>
            <div className='container'>
                <div className='my-container'>
                    <h1>Lets fill this world with positivity</h1>
                    <h4>Todays Challenges</h4>
                    <div className='row mt-2 mb-2'>
                        <div className='col-sm-12 col-md-6 col-lg-4'>
                            <ChallengeView 
                            bgcolor='#8cc251' 
                            title={'Talk/call your parents, have coffee with it'}
                            chapter={5}
                            minutes={20}
                            points={100}
                            />
                        </div>
                        <div className='col-sm-12 col-md-6 col-lg-4'>
                            <ChallengeView 
                            bgcolor='#ee4433'
                            title={'Talk/call your parents, have coffee with it'}
                            chapter={5}
                            minutes={20}
                            points={100}
                            />
                        </div>
                        <div className='col-sm-12 col-md-6 col-lg-4'>
                            <ChallengeView 
                            bgcolor='#2468ff'
                            title={'Talk/call your parents, have coffee with it'}
                            chapter={5}
                            minutes={20}
                            points={100}
                            />
                        </div>
                        <div className='col-sm-12 col-md-6 col-lg-4'>
                            <ChallengeView
                            bgcolor='#262626'
                            title={'Talk/call your parents, have coffee with it'}
                            chapter={5}
                            minutes={20}
                            points={100}
                            />
                        </div>
                        <div className='col-sm-12 col-md-6 col-lg-4'>
                            <ChallengeView bgcolor='#041e3f'/>
                        </div>
                        <div className='col-sm-12 col-md-6 col-lg-4'>
                            <ChallengeView bgcolor='#0099ff'/>
                        </div>
                    </div>

                </div>


            </div>
        </React.Fragment>
    )
}

export default Home;
